import React from 'react';
import { StyledFilters, Wrapper } from './styles';

const Filters: React.FC = () => {
  return (
    <StyledFilters>
      <Wrapper>
        Some filters
      </Wrapper>
    </StyledFilters>
  )
};

export default Filters;
